import * as React from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import "./SignIn.css"
import { createTheme, ThemeProvider } from '@mui/material/styles';



export default function SignIn_form() {
    const handleSubmit = (event) => {
        event.preventDefault();
        const data = new FormData(event.currentTarget);
        console.log({
            email: data.get('email'),
            password: data.get('password'),
        });
    };

    const theme = createTheme();

    return (
        <ThemeProvider theme={theme}>
            <Container sx={{ mt: "55px", p: "15px", border: '0px solid #636E51' }} component="main">
                <Grid container spacing={1}>
                    <Grid xs={6} md={6}>
                        <Box>
                            <Typography
                                variant="h3"
                                noWrap
                                sx={{
                                    display: { xs: 'none', md: 'flex' }, fontFamily: 'Kalam', fontWeight: 400,
                                    color: '#Cb6605',
                                    textDecoration: 'none'
                                }}
                            >
                                Join the susita community,<br />
                                make connections<br />
                                and rev up your passion
                            </Typography>
                        </Box>
                        <Box
                            sx={{
                                width: "420px",
                                marginTop: 0,
                                display: 'flex',
                                flexDirection: 'column',
                                alignItems: 'left',
                            }}
                        >
                            <Box component="form" onSubmit={handleSubmit} noValidate sx={{ mt: 1 }}>
                                <TextField
                                    margin="normal"
                                    required
                                    fullWidth
                                    id="email"
                                    label="Email, phone number or license plate"
                                    name="email"
                                    autoComplete="email"
                                    autoFocus
                                />
                                <TextField
                                    margin="normal"
                                    required
                                    fullWidth
                                    name="password"
                                    label="Password"
                                    type="password"
                                    id="password"
                                    autoComplete="current-password"
                                />
                                <Button
                                    type="submit"
                                    fullWidth
                                    variant="contained"
                                    sx={{ mt: 3, mb: 2 }}
                                >
                                    Sign In
                                </Button>
                            </Box>
                        </Box>
                    </Grid>
                    <Grid xs={6} md={6}>
                      <img src=".\signIn.png" style={{ marginTop: '-20px' }} width={'620px'} height='auto' />
                    </Grid>
                </Grid>
            </Container>
        </ThemeProvider>
    );
}
